import React from "react";
import attach from "../image/attach-file.png";
import gallery from "../image/gallery.png";
export default function input() {
  return (
    <div className="Input">
      <input
        type="text"
        style={{ display: "none" }}
        placeholder="Type something..."
      />
      <div className="Icons">
        <input type="file" style={{ display: "none" }} id="file" />
        <img src={attach} className="icon" />
        <label htmlFor="file">
          <img src={gallery} className="icon" />
        </label>
        <button>send</button>
      </div>
    </div>
  );
}
